import React from 'react'
import './Banner.css'
import BarChart from './BarChart.js'
function Banner() {
    const data = [4,5,62,3,3];
    return (
        <div>
            <div className="Banner__container">
                <div className="Banner__today">Dziś: 14,3</div>
                <div className="Banner__all">Ogółem: 233</div>
                <div className="Banner__graph"><BarChart data={data}/></div>
            </div>
        </div>
    )
}

export default Banner
